Achieving a Flawless Look Without Foundation: My Experience and Tips!⠀

A flawless NO FOUNDATION makeup application…how? I have been seeing this technique and I wanted to give it a try! Since I love a thin application, I was curious to see how it would turn out and honayyyy it is here to stay! 

I’m rocking it now and will post a selfie in my story! It wasn’t difficult at all to recreate, but I will say you can’t be afraid of highlighting and contouring. I opted for @makeupforever HD Skin Concealer 3.5Y for a skin-matching effect and used @makeupforever HD Skin Face Sculpting Palette for contouring. Patience is key for blending, but it’s easier than I thought without foundation as a base!

Currently swooning over @lauramercier’s Holiday Sets, I chose the new @lauramercier Tinted Moisturizer Blush “Promenade” from their holiday collection. Surprisingly pigmented, I skipped the powder blush. Also, used their Guiding Star set, featuring the translucent loose setting powder and puff at $43!

